package com.github.service;import com.github.model.User;import org.springframework.amqp.rabbit.annotation.RabbitHandler;import org.springframework.amqp.rabbit.annotation.RabbitListener;import org.springframework.stereotype.Component;@Component@RabbitListener(queues = "hello")public class ConsumerService {	@RabbitHandler	public void produce(User user) {		System.err.println(user);	}}